import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Products</h1>
      <div>
        <h3>Laptop</h3>
        <h4>£299.99</h4>
        <img src="https://brain-images-ssl.cdn.dixons.com/4/2/10199624/u_10199624.jpg"/>
      </div>

      <div>
        <h3>Item 1</h3>
        <h4>£299.99</h4>
        <img src="https://brain-images-ssl.cdn.dixons.com/4/2/10199624/u_10199624.jpg"/>
      </div>

    </div>
  );
}

export default App;
